    false,nt"url": null,nt"notes": "This annual narrative report for Bear Lake
    NWR outlines Refuge accomplishments during the 1968 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, raptors, fish,
    and reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments. Resource management is outlined; topics include permits.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and safety. Items of interest, N-R forms, photographs,
    and newspaper articles are attached.",nt"license_title": "License Not Specified",nt"extras":
